import React, { useEffect, useState } from "react";
import axios from "axios";


function Axios1()
{
    const [data,setData]=useState([]);
    useEffect(
        ()=>{axios.get("https://jsonplaceholder.typicode.com/posts").then((res)=>{setData(res.data)})},[]
    )
}

export default Axios1;
